function header1() {
    return (
<header class="header">
    {/* HEADER ACTIONS */}
    <div class="header-actions">
      {/* HEADER BRAND */}
      <div class="header-brand">
        {/* LOGO */}
        <div class="logo">
          {/* ICON LOGO VIKINGER */}
          <svg class="icon-logo-vikinger small">
            <use xlinkHref="#svg-logo-vikinger"></use>
          </svg>
          {/* /ICON LOGO VIKINGER */}
        </div>
        {/* /LOGO */}

        {/* HEADER BRAND TEXT */}
        <h1 class="header-brand-text">Superteam UK</h1>
        {/* /HEADER BRAND TEXT */}
      </div>
      {/* /HEADER BRAND */}
    </div>
    {/* /HEADER ACTIONS */}

    {/* HEADER ACTIONS */}
    <div class="header-actions">
      {/* SIDEMENU TRIGGER */}
      <div class="sidemenu-trigger navigation-widget-trigger">
        {/* ICON GRID */}
        <svg class="icon-grid">
          <use xlinkHref="#svg-grid"></use>
        </svg>
        {/* /ICON GRID */}
      </div>
      {/* /SIDEMENU TRIGGER */}

      {/* MOBILEMENU TRIGGER */}
      <div class="mobilemenu-trigger navigation-widget-mobile-trigger">
        {/* BURGER ICON */}
        <div class="burger-icon inverted">
          {/* BURGER ICON BAR */}
          <div class="burger-icon-bar"></div>
          {/* /BURGER ICON BAR */}

          {/* BURGER ICON BAR */}
          <div class="burger-icon-bar"></div>
          {/* /BURGER ICON BAR */}

          {/* BURGER ICON BAR */}
          <div class="burger-icon-bar"></div>
          {/* /BURGER ICON BAR */}
        </div>
        {/* /BURGER ICON */}
      </div>
      {/* /MOBILEMENU TRIGGER */}

      {/* NAVIGATION */}
      <nav class="navigation">
        {/* MENU MAIN */}
        <ul class="menu-main">
          {/* MENU MAIN ITEM */}
          <li class="menu-main-item">
            {/* MENU MAIN ITEM LINK */}
            <a class="menu-main-item-link" href="#">Home</a>
            {/* /MENU MAIN ITEM LINK */}
          </li>
          {/* /MENU MAIN ITEM */}

          {/* MENU MAIN ITEM */}
          <li class="menu-main-item">
            {/* MENU MAIN ITEM LINK */}
            <a class="menu-main-item-link" href="#">Careers</a>
            {/* /MENU MAIN ITEM LINK */}
          </li>
          {/* /MENU MAIN ITEM */}

          {/* MENU MAIN ITEM */}
          <li class="menu-main-item">
            {/* MENU MAIN ITEM LINK */}
            <a class="menu-main-item-link" href="#">Faqs</a>
            {/* /MENU MAIN ITEM LINK */}
          </li>
          {/* /MENU MAIN ITEM */}

          {/* MENU MAIN ITEM */}
          <li class="menu-main-item">
            {/* MENU MAIN ITEM LINK */}
            <p class="menu-main-item-link">
              {/* ICON DOTS */}
              <svg class="icon-dots">
                <use xlinkHref="#svg-dots"></use>
              </svg>
              {/* /ICON DOTS */}
            </p>
            {/* /MENU MAIN ITEM LINK */}

            {/* MENU MAIN */}
            <ul class="menu-main">
              {/* MENU MAIN ITEM */}
              <li class="menu-main-item">
                {/* MENU MAIN ITEM LINK */}
                <a class="menu-main-item-link" href="#">About Us</a>
                {/* /MENU MAIN ITEM LINK */}
              </li>
              {/* /MENU MAIN ITEM */}

              {/* MENU MAIN ITEM */}
              <li class="menu-main-item">
                {/* MENU MAIN ITEM LINK */}
                <a class="menu-main-item-link" href="#">Our Blog</a>
                {/* /MENU MAIN ITEM LINK */}
              </li>
              {/* /MENU MAIN ITEM */}

              {/* MENU MAIN ITEM */}
              <li class="menu-main-item">
                {/* MENU MAIN ITEM LINK */}
                <a class="menu-main-item-link" href="#">Contact Us</a>
                {/* /MENU MAIN ITEM LINK */}
              </li>
              {/* /MENU MAIN ITEM */}

              {/* MENU MAIN ITEM */}
              <li class="menu-main-item">
                {/* MENU MAIN ITEM LINK */}
                <a class="menu-main-item-link" href="#">Privacy Policy</a>
